import React, { useEffect, useState } from 'react';
import { useSelector } from 'react-redux';
import { isEmpty } from '../Utils';

const FieldCard = ({ field }) => {
    const fieldData = useSelector((state) => state.fieldReducer);
    useEffect(() => {
        !isEmpty(fieldData[0]) && setIsLoading(false);
    }, [fieldData])

    return (
        <li class="field_card" key={field._id}>
            {fieldData.green}
        </li>
    );
};

export default FieldCard;
